"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[725],{725:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Прайд-центр округу Сан-Матео","description":"Прайд-центр округу Сан-Матео - це модель співпраці та універсальний центр для спільноти LGBTQ+. Ми пропонуємо потужні програми та послуги для підтримки членів спільноти LGBTQ+ всіх вікових категорій, включаючи освіту, навчання, спільнотні заходи, групи однолітків, щоденну програмування, клінічну терапію та кейс-менеджмент."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"Жвава онлайн спільнота та центр знань для осіб, які цікавляться самостійною замінною гормональною терапією (HRT). Їхній вебсайт призначений для надання безпечного та включного простору, де люди можуть отримувати інформацію, ресурси та підтримку для самостійної HRT. Неважливо, досліджуєте ви альтернативні методи, шукаєте керівництво щодо дозування та адміністрації, або просто хочете зв\'язатися з іншими, хто має подібний досвід, DIYHRT.cafe пропонує багатство цінних оглядів, особистих історій та експертних порад, щоб допомогти вам приймати обгрунтовані рішення щодо вашого здоров\'я та благополуччя."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"Повнофункціональна онлайн-платформа, призначена для підтримки осіб, які переходять від жіночої до чоловічої статі (FTM). Їхній веб-сайт служить надійним ресурсом, пропонуючи безліч інформації, керівництва та взаємозв\'язків спільноти для тих, хто вступає на шлях FTM. Починаючи від практичних порад щодо гормональної терапії та хірургічних варіантів до підтримки психічного здоров\'я та особистих історій, FTMGuide.org прагне наділити осіб знаннями та ресурсами, які їм необхідні для того, щоб прокласти шлях переходу з впевненістю та ясністю."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"Передова онлайн-платформа, присвячена наданню доказово-базованих досліджень, освіти та ресурсів для трансгендерної та небінарної громади, з особливим акцентом на фемінізуючу гормональну терапію (ФГТ). Їх веб-сайт слугує важливим центром для осіб, які шукають надійну та актуальну інформацію про медичні, фізіологічні та психологічні аспекти ФГТ. За допомогою їх всеосяжного зібрання рецензованих досліджень, експертних статей та практичних посібників, їх сайт здатен розширити права осіб, передбачаючи їх прийняття обізнаних рішень про їх перехід та здоров\'я."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"Надійний онлайн-ресурс для людей, які шукають знання, підтримку та розуміння гендерної дисфорії. Їх веб-сайт надає багато інформації, ресурсів та зв\'язків з громадою, щоб заохочувати людей у їхньому шляху. Від всеосяжних посібників про гендерну ідентичність та перехід до особистих історій та професійних порад, вони прагнуть створити безпечне та інклюзивне середовище для всіх."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Проект Просування Руху","description":"Проект Просування Руху (MAP) - це незалежний, некомерційний думковий центр, який надає ретельne дослідження, внутрішнє сприйняття та комунікації, які допомагають прискорити рівність і можливості для всіх. MAP працює, щоб гарантувати, що всі люди мають рівні можливості досягнути здоров\'я та щастя, заробляти на життя, дбати про тих, кого вони люблять, бути в безпеці в своїх громадах та брати участь у громадському житті."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Комунікаційні послуги Jordan Ross","description":"Jordan Ross надає тренінги з мови, голосу та комунікації для транс, квір і осіб, які не відповідають гендерним нормам. Він пропонує 1-на-1 тренування, онлайн-курси, заходи та програму тренування \'Voice Within Coaching Program\'. Його підхід включає нейро-лінгвістичне програмування, гіпнотерапію, інструкції з йоги та тренінги дихання, маючи на меті звернути увагу не лише на фізичні, але й на ментальні, емоційні та енергетичні аспекти комунікації."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"Онлайн портал освіти Gender Dynamix","description":"Gender Dynamix - це організація без прибуткової організації, що базується в Африці та має на меті сприяти, розвивати та захищати права людей транс та гендерно-різноманітних спільнот у Південній Африці та у всій південній Африці. Організація проводить захист інтересів, сприяє підвищенню потенціалу та надає прямі послуги спільноті. Вони також пропонують онлайн-ресурси, пов\'язані з охороною здоров\'я, освітніми програмами та визнанням гендеру за законом."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Юридичний проект Сильвії Рівера (SRLP)","description":"Юридичний проект Сильвії Рівера працює над гарантуванням того, що всі люди мають право вільно визначати свою статеву приналежність і самовираження, незалежно від доходів або раси, і без страху зазнавати домагання, дискримінації або насильства. SRLP надає юридичну допомогу, організовує кампанії, проводить тренінги та керує Комітетом консультативних в\'язнів. Спільнотна участь заохочується через пожертви, волонтерство та членство."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"Ерін ранком","description":"Новини та дискусії про законодавство для трансгендерів та життя. Від Ерін Рід · Понад 38 000 передплатників"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"Інноваційна онлайн-платформа, що має на меті створити всеосяжний та актуальний ресурс для глобальних прав LGBTQ+. Їх веб-сайт надає централізовану базу даних законів, політик та суспільних ставлення до прав LGBTQ+ зі всього світу. Візуалізуючи та відображаючи дані про рівність, інклюзивність та правовий захист, EqualDex.com пропонує потужний інструмент для активістів, дослідників та осіб, які прагнуть зрозуміти та відстоювати права LGBTQ+ на глобальному рівні. Досліджуйте їхні інтерактивні карти, переглядайте профілі конкретних країн та слідкуйте за останніми досягненнями та викликами, з якими стикається співтовариство LGBTQ+ у всьому світі."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans - це глобальна мережа індустрії волосся, краси та здоров\'я, а також організацій, які прагнуть створювати та надихати на безпечні та позитивні переживання для всіх гостей, особливо гостей із трансспільноти."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Тихоокеанський центр розвитку людини","description":"Заснований у 1973 році, Тихоокеанський центр розвитку людини є найстарішим центром LGBTQIA+ в заливі, третім за старістю в країні, і оперує єдиною клінікою психічного здоров\'я для людей LGBTQIA+ та QTBIPOC та їхніх сімей в окрузі Аламеда, де встановлено плаваючу шкалу."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Центр LGBTQ спільноти Окленд","description":"Перший в Окленді некомерційний центр обслуговування LGBTQ спільноти для всіх вікових груп, 501c3. Послуги, що надаються, включають підтримувальні групи, психічну підтримку, допомогу з житлом, молодіжну програму, юридичну клініку, продуктовий склад тощо. Також проводяться спеціальні програми для людей похилого віку LGBTQ+ і трансгендерних членів спільноти."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"Статева різноманітність","description":"Статева різноманітність покращує благополуччя дітей та дорослих усіх статевих ідентичностей і виражень, забезпечуючи освіту, підвищуючи обізнаність та надаючи зрозуміння широкого спектра людського досвіду. Ми також допомагаємо у створенні підтримуючих та нетолерантних дискримінаційних середовищ в школах, спортивних командах, місцях роботи та у надавачів медичних послуг для трансгендерних осіб та осіб з різноманітністю статі."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"Національний центр за рівність трансгендерів","description":"Національний центр за рівність трансгендерів - це організація, яка пропагує зміну політик та соціальних ставлень до підвищення розуміння та прийняття трансгендерних людей. NCTE надає інформацію про проблеми, які впливають на трансгендерну спільноту, включаючи старіння, антинасильство, зайнятість, сім\'ї, здоров\'я та ВІЛ, житло та бездомність і багато іншого."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"Внутрішнє Коло","description":"Міжнародна Мусульманська громада, що має на меті принести зцілення Мусульманам, які є відмежованими за орієнтацією і гендерною самосвідомістю через духовність, освіту та створення руху"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Домашня сторінка зміни імені в штаті Флорида","description":"Цей вебсайт надає покрокову інструкцію для тих, хто хоче оновити своє ім\'я або стать в штаті Флорида. Кроки включають подачу петиції в суд, а також оновлення картки соціального захисту, водійського посвідчення, паспорту та свідоцтва про народження."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"The Trevor Project - це американська неприбуткова організація, яка надає послуги з попередження самогубств для молоді LGBTQ+. Сайт надає цінні ресурси для спільноти трансгендерів, включаючи кризову інтервенцію, телефон лінії попередження самогубств, TrevorChat і TrevorText, а також рекомендації з психічного здоров\'я, соціальних послуг і груп підтримки."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"Місце для Марши","description":"Місце для Марши - один з численних стартап-проектів, спрямованих на допомогу трансгендерним особам та їх сім\'ям у дедалі небезпечніших штатах, щоб вони могли перебратися в безпечніше місце. APFM розпочала свій шлях у березні 2023 року як відповідь на зростання антітрансгендерного законодавства у країні. Тепер APFM зосереджується на пошуку співмешканців для біженців з червоних штатів, обережно працюючи з кожним домогосподарством окремо."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"Метрополітенська церква GOOD HOPE","description":"Теологічно прогресивна та інклюзивна християнська спільнота, заснована на принципах Ісуса Христа, яка святкує різноманітність і забезпечує безпечне, неосудливе місце, де всі вітаються. Частина інклюзивного християнського збору, базованого в Кейптауні, Південна Африка, і є частиною більшого міжнародного деномінації, відомої як Метрополітенські церкви спільноти (MCC)."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons пропонує якісні послуги контролю та звільнення голосу для трансгендерних та небінарних осіб, які прагнуть звучати більш чоловічим, жіночим або андрогіним."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"Важна онлайн-платформа, яка присвячена допомозі та захисту осіб LGBTQ+, які стикаються з переслідуваннями та насиллям у всьому світі. З незмінним зобов\'язанням, веб-сайт з\'єднує тих, хто перебуває в безпосередній небезпеці, з ресурсами, що рятує життя, надзвичайною допомогою та безпечними шляхами до безпеки. За допомогою партнерства з місцевими організаціями та мережі співчутливих підтримувачів, RainbowRailroad.org неухильно працює, щоб забезпечити захист, юридичну допомогу та підтримку переселення, дозволяючи особам уникнути переслідування та знайти притулок. Захищаючи права людини, рятується життя та сприяється створенню більш інклюзивного світу, RainbowRailroad.org служить маяком надії та захисту для осіб LGBTQ+, що шукають безпеку та свободу."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Проект McKenzie","description":"Всебічний ресурс, який пропонує послуги, програми та заходи, спрямовані на справедливість стосовно статевої належності та обслуговування трансгендерної спільноти. Включає в себе служби підтримки та ресурси, зокрема медичне обслуговування, юридичну допомогу, послуги з питань психічного здоров\'я та багато іншого."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Східна Затока - Рада Транс і Квір","description":"Центр \\"Східна Затока - Рада для Транс і Квір\\" пропонує послуги за скальованими цінами, які включають: Індивідуальну терапію, що знаходиться в центрі Берклі, штат Каліфорнія, підтримку в процесі дослідження гендерної самоідентифікації та переходу, рекомендаційні листи для прийому гормонів і проведення операцій, професійні навчання студентам, роботодавцям та працівникам у сфері психічного здоров\'я. Сем Девіс - трансгендер, що відносять себе до гендерно-квир, та ліцензований клінічний соціальний працівник (LCSW), спеціалізований на роботі з транс, квір, гендерно-квір та невизначеними за статтю підлітками та дорослими. Вони мають 16 років досвіду роботи в сфері психічного здоров\'я у Східній Затоці, включаючи проведення групових занять з підтримки однолітків, спільнотна освіта на конференціях LGBTQI, та 9 років клінічної практики та кризового консультування сильно маргіналізованих людей для округу Аламеда. Вони є сильним та відданим захисником з довгою історією організації в захист маргіналізованих людей."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub - це цифрова платформа інформації та ресурсів для всіх трансів та людей, котрі відмінні від гендеру, в Новій Південній Уельс, для їхніх близьких, союзників та постачальників охорони здоров\'я. Вона надає доступ до необхідної інформації та ресурсів для спільноти, котра, можливо, не мала доступу до такого, коли вони вирощували або прямували до своїх автентичних особистостей. Інформація відтворюється від медичних потреб, таких як гормони, операції та списки лікарів, до соціальних та правових питань."},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"Трансгендерна карта","description":"Transgendermap.com - це онлайн-ресурс, метою якого є надання практичної інформації та керівництва людям, які ставлять питання про свою гендерну ідентичність або є десь на трансгендерному спектрі. Веб-сайт включає велику кількість тем, таких як розуміння термінології трансгендерів, процеси переходу, юридичні питання, охорона здоров\'я, а також численні особисті історії. Його метою є допомога людям рухатися по їх особистим маршрутам, надаючи \'карту\' чи посібник до багатьох аспектів гендерної ідентичності та трансгендерного досвіду. Будь ласка, відвідайте актуальний сайт для отримання найбільш актуальної та точної інформації."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Транссексуальні Сім\'ї","description":"Транссексуальні Сім\'ї надихають на надію, підвищують розуміння та створюють видимий шлях до підтримки транссексуальних та гендерно різноманітних дітей, а також всіх тих, хто входить в їхнє життя. Ми надаємо ресурси, організовуємо заходи та з\'єднуємо сім\'ї з групами підтримки."}]')}}]);